import React from 'react'

import './header.styles.scss'

const Header = () => {
    return (
        <header style = {{backgroundImage: `url(https://cdn-ep19.pressidium.com/wp-content/uploads/2018/04/Food-Photography-Styling-Chocolate-Ganache-Layer-Cake.jpg)`}}>
            <div className="overlay">
            </div>
        </header>
    )
}

export default Header;
